//import style from '../SearchBar/SearchBar.module.css';
//import { useState } from "react";
import React from "react";

export default function SearchBar({ onSearch }) {
   return (
      <div>
      <form> onSubmit={(e) =>{
         e.preventDefault();
         onSearch("Cairns");
      }}
      </form>
         <input
         type="text"
         placeholder="Cuidad..."/>
         <input type="submit" valur="Agregar" />
         </div>
   );
}
